INSERT INTO `movies` (`id`, `genre_id`, `title`, `photo`, `description`, `rating`, `created_at`, `updated_at`) VALUES
(1, 1, 'Now, We are Breaking Up', 'https://asianwiki.com/images/1/10/Now_We_Are_Breaking_Up-tp02.jpg', 'The series is story of love and break ups in the romantic world. It illustrates the present scenario in the context of fashion industry. Ha Yeong-eun (Song Hye-kyo) is a beautiful, trendy team leader of design department of a fashion company called \'The One\'. Yoon Jae-gook (Jang Ki-yong) is a successful freelance photographer.', 7.20, '2022-05-27 18:53:29', '2022-05-27 18:53:29'),
(2, 1, 'Lovers of the Red Sky', 'https://asianwiki.com/images/d/de/Red_Sky_Korean_Drama-p1.jpg', 'Set during the Dan dynasty era when ghosts, demons and gods are involved in human life, the story recounts the fateful relationship of a female painter (Kim Yoo-jung) and a blind astrologer (Ahn Hyo-seop).', 9.10, '2022-05-27 18:53:29', '2022-05-27 18:53:29'),
(3, 1, 'Doom at Your Service', 'https://asianwiki.com/images/7/74/Doom_at_Your_Service-P1.jpg', 'Tak Dong-Kyung (Park Bo-Young) is an editor for a web novel company. Myul-Mang (Seo In-Guk), suddenly appears in her ordinary life. She makes a 100 day contract with Myul-Mang, risking her life and her love. Myul-Mang is the existence of a middle manager between God and humans. He makes a contract with Tak Dong-Kyung.', 8.90, '2022-05-27 18:53:29', '2022-05-27 18:53:29'),
(4, 1, 'River Where the Moon Rises', 'https://asianwiki.com/images/b/bd/River_Where_The_Moon_Rises-tp01.jpeg', 'A love story between Pyong Gang and On Dal. Pyong Gang (Kim So-Hyun) is princess of Goguryeo. She was raised as a soldier for Goguryeo as soon as she was born. She is ambitious enough to dream of becoming the King of Goguryeo. She meets a man named On Dal (Ji Soo).', 9.00, '2022-05-27 18:53:29', '2022-05-27 18:53:29'),
(5, 1, 'Penthouse', 'https://asianwiki.com/images/4/48/Penthouse-Korean_Drama-P1.jpg', 'Penthouse tells the story of wealthy families living in Hera Palace and their children at Cheong-ah Arts School. Shim Su-ryeon (Lee Ji-ah) is an elegant, wealthy woman who has a tragic past. Her husband is Joo Dan-tae (Uhm Ki-joon), a successful businessman. She later learns that he is hiding a secret from her.', 8.80, '2022-05-27 18:53:29', '2022-05-27 18:53:29'),
(6, 1, 'Goblin', 'https://asianwiki.com/images/b/b2/Goblin-p04.jpg', 'Goblin is a fantasy romance about a modern day goblin (Gong Yoo) who seeks to end his cursed immortal life and needs a human bride (Kim Go Eun) to do so.  His life then becomes intertwined with a grim reaper (Lee Dong Wook) who is unable to remember his past. But when the goblin finally finds his bride, he suddenly realizes he wants to live and be with her.', 9.10, '2022-05-27 18:53:29', '2022-05-27 18:53:29'),
(7, 1, 'Mr. Queen', 'https://asianwiki.com/images/6/61/Mr._Queen-P1.jpg', 'The story begins with a modern age chef Jang Bong-Hwan (Choi Jin Hyuk) who works in the Blue House (South Korean Presidential residence). He meets with an accident and his soul time travels in the past in a historical period during Joseon era and then gets trapped in the body of Queen Cheorin (Shin Hye-sun).', 9.20, '2022-05-27 18:53:29', '2022-05-27 18:53:29'),
(8, 1, 'The K2', 'https://asianwiki.com/images/f/ff/The_K2-p1.jpg', 'Kim Je-Ha (Ji Chang-Wook) is former solider for hire. He is also called K2. He is hired as a bodyguard by Choi Yoo-Jin (Song Yoon-A). Choi Yoo-Jin is the wife of a presidential candidate (Cho Seong-Ha) and the daughter from a chaebol family. Meanwhile, Ko An-Na (Lim Yoon-A) is the secret daughter of the presidential hopeful. She is also a recluse.', 8.80, '2022-05-27 18:53:29', '2022-05-27 18:53:29'),
(9, 1, 'True Beauty', 'https://asianwiki.com/images/e/ee/True_Beauty-P1.jpg', 'Im Ju-Kyung (Mun Ka-Young) is a high school student. Since she was little, she has had a complex about her appearance. To hide her bare face, Im Ju-Kyung always wears make-up. Her excellent make-up skills makes her pretty and she hides her bare face in front others. She gets involved with 2 men; Lee Soo-Ho (Cha Eun-Woo) and Han Seo-Joon (Hwang In-Yeop).', 8.50, '2022-05-27 18:53:29', '2022-05-27 18:53:29'),
(10, 1, 'The Heirs', 'https://asianwiki.com/images/4/48/The_Heirs_-_Korean_Drama-p1.jpg', 'The series follows a group of wealthy, privileged high school students as they are about to take over their families\' business empires, overcoming difficulties and growing every step of the way. Kim Tan (Lee Min-ho) is a wealthy heir to a large Korean conglomerate called Jeguk Group.', 9.00, '2022-05-27 18:53:29', '2022-05-27 18:53:29'),
(11, 2, 'BoBoiBoy', 'https://m.media-amazon.com/images/M/MV5BNmFjYTcyMTktNmIzMC00MTA4LWJmYTEtN2U0ZTdhNWRlYWM4XkEyXkFqcGdeQXVyNjc5MjE5Nzg@._V1_.jpg', 'A kid name boboiboy found out there was an alien that try to invade their planet.a robot name ochobot give boboiboy and his friend a power to save their planet', 5.90, '2022-05-27 18:53:29', '2022-05-27 18:53:29'),
(12, 2, 'Tom & Jerry', 'https://image.tmdb.org/t/p/original/t8Wi0KdSDfVsWOMvFtJg34gkhL4.jpg', 'Tom and Jerry is an American cartoon series about a hapless cat\'s never-ending pursuit of a clever mouse. Tom is the scheming cat, and Jerry is the spunky mouse. The series was driven entirely by action and visual humour although the characters almost never spoke.', 7.80, '2022-05-27 18:53:29', '2022-05-27 18:53:29'),
(13, 2, 'Garfield and Friends', 'https://image.tmdb.org/t/p/original/pE6l6I1ICKOu4pDUXxkl87TTLZx.jpg', 'Stories about Garfield the cat, Odie the dog, their owner Jon and the trouble they get into, and Orson the Pig and his adventures on a farm with fellow farm animals.', 7.20, '2022-05-27 18:53:29', '2022-05-27 18:53:29'),
(14, 2, 'Phineas and Ferb', 'https://image.tmdb.org/t/p/original/5M1KD34oDBjnmVQhdvoVNYgMugc.jpg', 'An animated comedy about two stepbrothers, Phineas and Ferb, who find inventive things to do on each day of their summer vacation, such as building a roller coaster out of materials you would find in your everyday home like Popsicle sticks, indoor plumbing, et cetera.', 8.00, '2022-05-27 18:53:29', '2022-05-27 18:53:29'),
(15, 2, 'Courage the Cowardly Dog', 'https://m.media-amazon.com/images/M/MV5BMTU4MGEyNTItNzg5ZS00ZGU0LTk4NmEtODM0Y2UxYTY2YTUyXkEyXkFqcGdeQXVyNTAyODkwOQ@@._V1_FMjpg_UX1000_.jpg', 'The offbeat adventures of Courage, a cowardly dog who must overcome his own fears to heroically defend his unknowing farmer owners from all kinds of dangers, paranormal events and menaces that appear around their land.', 8.30, '2022-05-27 18:53:29', '2022-05-27 18:53:29'),
(16, 2, 'The Powerpuff Girls', 'https://picfiles.alphacoders.com/410/410329.jpg', 'Fed up with the criminals, Professor Utonium, decides to help the people by creating a perfect little girl (composed of sugar, spice and everything nice). But in an instant dose of Chemical X, what he gets is three little girls whom he names Blossom, Bubbles and Buttercup.', 7.30, '2022-05-27 18:53:29', '2022-05-27 18:53:29'),
(17, 2, 'The Flintstones', 'https://picfiles.alphacoders.com/365/365084.jpg', 'Residing in Bedrock, Fred Flintstone worked an unsatisfying quarry job, but returned home to lovely wife Wilma and eventually daughter Pebbles. Fred, a big fan of golf and bowling, also enjoyed bullying neighbor Barney Rubble, while Barney\'s saucy wife Betty was best friends with Wilma.', 7.50, '2022-05-27 18:53:29', '2022-05-27 18:53:29'),
(18, 2, 'Scooby Doo, Where Are You!', 'https://images.justwatch.com/poster/253146654/s718/scooby-doo-where-are-you.%7Bformat%7D', 'A group of teenage friends and their Great Dane (Scooby-Doo) travel in a bright green van solving strange and hilarious mysteries, while returning from or going to a regular teenage function.', 7.90, '2022-05-27 18:53:29', '2022-05-27 18:53:29'),
(19, 3, 'Running Man', 'https://i.pinimg.com/564x/c1/09/85/c10985bc30715f42d872605fbcedf2b9.jpg', 'Running Man is a reality-variety show where the cast must complete missions at various places to win the race. Running Man is a reality-variety show where the cast must complete missions at various places to win the race.', 9.20, '2022-05-27 18:53:29', '2022-05-27 18:53:29'),
(20, 3, 'My Little Old Boy', 'https://img.betaseries.com/YfF6N4EbHTJJrjC67B-y6zTASYk=/600x900/smart/https%3A%2F%2Fpictures.betaseries.com%2Ffonds%2Fposter%2F620cf14cf6a751609fa27fcbc8bc01ec.jpg', 'This reality program focuses on the mothers of South Korean celebrities. Unlike the generic reality program which focuses solely on the celebrity, My Little Old Boy features commentary from the celebrities\' mothers as they watch the footage of their sons and or daughters\' daily activities.', 8.20, '2022-05-27 18:53:29', '2022-05-27 18:53:29'),
(21, 3, 'Infinite Challenge', 'https://image.tmdb.org/t/p/w500/3ZIPTvMnzI5ThmdGeEYQFxJV5Sg.jpg', 'Infinite Challenge is a show that stars Yu Jae Seok, Park Myeong Soo, Jung Jun Ha, Haha, Yang Se Hyeong, and Cho Sae Ho. Together, they complete various missions that are deemed difficult or impossible. Each week is filled with laughter and fun due to the on-screen chemistry of these six men.', 8.10, '2022-05-27 18:53:29', '2022-05-27 18:53:29'),
(22, 3, 'Do or Die', 'https://www.tvguide.com/a/img/catalog/provider/1/1/1-1495651783.jpg', 'When the choices you make mean the difference between life and death, would you know how to stay alive? Do or Die features stories of real people in desperate situations and reveals the shocking science behind their choices that might just save your life.', 8.60, '2022-05-27 18:53:29', '2022-05-27 18:53:29'),
(23, 3, 'Men On a Mission', 'https://image.tmdb.org/t/p/original/a1rnHdqAvEm5NUWJ2SRzBY4Hkt5.jpg', 'Men On a Mission current fixed cast includes Kang Ho-dong, Lee Soo-geun, Kim Young-chul, Seo Jang-hoon, Kim Heechul, Min Kyunghoon, Lee Sangmin, and Lee Jin-ho; Hwang Chi-yeul and Kim Se-hwang were initial cast members in the program\'s first few episodes. Jang Sung-kyu and Shindong have appeared as recurring special guests by hosting the show\'s game segments. The show received several accolades during its run.', 8.70, '2022-05-27 18:53:29', '2022-05-27 18:53:29'),
(24, 3, 'The Law of Jungle', 'https://m.media-amazon.com/images/M/MV5BZGRhNTU2NDgtNjRlMS00MjIyLWI3MjctODFkZmVkZWU2NTVhL2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyNjIzNjIxNzc@._V1_.jpg', 'Law of the Jungle is a hybrid reality show combining elements of drama and documentary. The show is hosted by comedian Kim Byung Man, and each episode invites various celebrities from the various field. So far, many of idol stars and famous actors have appeared on the show. The show introduces viewers to exotic locations around the world where celebrities must work together in order to complete missions and survive.', 9.20, '2022-05-27 18:53:29', '2022-05-27 18:53:29'),
(25, 3, 'Hangout with Yoo', 'https://m.media-amazon.com/images/M/MV5BNGUzMjcyN2QtYTUxYS00NTE3LTliODktOGZlMDlkYjc1MjIxXkEyXkFqcGdeQXVyMTI1OTY3MzM3._V1_.jpg', 'This is a show that was started in order to find out what Yoo Jae-suk would be doing during his days off. Subsequently, the show showcases Yoo taking on various projects, with him taking on various secondary roles.', 8.90, '2022-05-27 18:53:29', '2022-05-27 18:53:29'),
(26, 3, 'Live Below Zero°', 'https://flxt.tmsimg.com/assets/p18740985_b_v10_aa.jpg', 'The show follows people living in the remote areas of Alaska, surviving off the land, making money through various ventures, as well as dealing with the many different challenges that come with living so remotely in such an unforgiving environment.', 9.20, '2022-05-27 18:53:29', '2022-05-27 18:53:29'),
(27, 3, 'Brain Games', 'https://cdn1.edgedatg.com/aws/v2/natgeo/BrainGames/showimages/3a3ddf0eac16ffae363c86088a2150ef/588x783-Q80_3a3ddf0eac16ffae363c86088a2150ef.jpg', 'Brain Games returns featuring high-stakes stunts, celebrity brain gamers, and jam packed interactive games. Episode themes include: Battle of the Sexes, Music, Optical Delusions, Performance, Power/Persuasion, Laws of Attraction, Movie Magic, and Kids vs. Adults', 9.20, '2022-05-27 18:53:29', '2022-05-27 18:53:29'),
(28, 3, 'Genius', 'https://flxt.tmsimg.com/assets/p13876734_b_v8_aa.jpg', 'Genius is a show that explores the turbulent journey of the physicist who would grow to become the icon: Albert Einstein. Consequently, this series will change the way we view Einstein. From their days as young adults to their final years we see their discoveries, loves, relationships, causes, flaws and genius.', 8.90, '2022-05-27 18:53:29', '2022-05-27 18:53:29');
